import './App.css';
import { BrowserRouter, Routes,Route } from 'react-router-dom';

import Header from '../src/components/header';
import Footer from '../src/components/footer';
import Home from './pages/home';
import AboutUs from '../src/pages/About_Us';
import ContactUs from './pages/Contact_Us';
import Tours from './pages/Tours';
import Login from './pages/authentification/Login';
import CreateAccount from './pages/authentification/CreateAccount';
import ResetPassword from './pages/authentification/ResetPassword';
import CheckEmail from './pages/authentification/CheckEmail';
import  NewPassword from '../src/pages/authentification/NewPassword';
import ApprovedPassword from './pages/authentification/ApprovedPassword';
import HaveTickets from '../src/pages/Purchase/account/HaveTickets';
import NoTickets from '../src/pages/Purchase/account/NoTickets'
import SpecificTour from '../src/pages/SpecificTour'


import BookingDetails from './pages/Purchase/BookingDetails';
import Payment from '../src/pages/Purchase/Payment'
// import ToursProvider from './context/ToursContext';
// import AuthProvider from './context/AuthContext';
import UserDetails from './pages/Purchase/UserDetails';
import { TourProvider } from './context/ToursContext';
// import DateProvider from './context/DateContext';
// import BookProvider from './context/BookContext';


function App() {
  return (
    <div className="App"> 



{/* <DateProvider> */}





{/* <BookProvider> */}


<TourProvider value={{selectedDay,selectedTime}}>


  <BrowserRouter> 
      <Header />

        <Routes>
          <Route path="/" element={<Home/>} />
          <Route path="/aboutUs" element={<AboutUs />} />
          <Route path="/tours" element={<Tours />} />
          <Route path="/tours/:id" element={<SpecificTour />} /> 
          <Route path='/contact' element={<ContactUs/>}/>


          <Route path='/BookingDetails/:id' element={<BookingDetails/>}/>
          <Route path='/User' element={<UserDetails/>}/>
          <Route path='/Payment' element={<Payment/>}/>

          <Route path="/login" element={<Login />} />
          <Route path='/login/haveTickets' element={<HaveTickets/>}/>
          <Route path='/login/noTickets' element={<NoTickets/>}/>

        <Route path="/login/createAccount" element={<CreateAccount />} />
        <Route path='/login/resetpassword' element={<ResetPassword/>}/>
        <Route path='/login/checkemail' element={<CheckEmail/>}/>
        <Route path='/login/newPassword' element={< NewPassword/>}/>
        <Route path='login/newPassword/approvedPassword' element={<ApprovedPassword/>}/>
      </Routes>

    <Footer />
  </BrowserRouter>
  </TourProvider>
  {/* </BookProvider> */}
  {/* </DateProvider> */}
    </div>
  );
}

export default App;
